function TemizlikEndustriyelBulasikMakinesKirecTemzilemePage() {
  return (
    <>
      <TemizlikEndustriyelBulasikMakinesKirecTemzileme />
      <ProductSimilarTemizlik />
    </>
  );
}

export default TemizlikEndustriyelBulasikMakinesKirecTemzilemePage;
